import React from 'react'
import FormSignup from './FormSignup'
import FormSuccess from './FormSuccess'
import './Form.css'



const Form = () => {
    const [isSubmitted, setIsSubmitted] = useState(false)

    function submitForm() {
        setIsSubmitted(true);
    }

    return (
        <div>
            {/* <FormSignup /> */}
            {!isSubmitted ? (<FormSignup submitForm = {submitForm} />): (<FormSuccess/>)}

        </div>
    )
}

export default Form
